'use strict';


function intersperse(aList, seperator) {
  if (!aList) {
    return /* [] */0;
  }
  var rest = aList.tl;
  var a = aList.hd;
  if (rest) {
    return {
            hd: a,
            tl: {
              hd: seperator,
              tl: intersperse(rest, seperator)
            }
          };
  } else {
    return {
            hd: a,
            tl: /* [] */0
          };
  }
}

exports.intersperse = intersperse;
/* No side effect */
